import React, { Fragment } from "react";
import { Gradient } from "react-gradient";

const About = () => {
  const gradients = [
    ["#59c2ff", "#1270e3"],
    ["#8739e5", "#ff63de"]
  ];
  return (
    <Gradient
      gradients={gradients}
      property='background'
      duration={8000}
      angle='45deg'
    >
        <div className="container-fluid px-0">
          <div className="row no-gutters">
            <div className="col-12">
              (edge-to-edge content)
            </div>
          </div>
        </div>
    </Gradient>
  );
};

export default About;
